import React from 'react';
import {  Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, PieChart } from 'recharts';

const AverageSessionsChart = ({ data }) => {
  return (
    <PieChart width={600} height={300} data={data} margin={{ top: 5, right: 30, left: 20, bottom: 5 }}>
      <CartesianGrid stroke="#ccc" strokeDasharray="3 3" />
      <XAxis dataKey="name" />
      <YAxis />
      <Tooltip />
      <Legend />
      <Bar dataKey="sessions" fill="#8884d8" />
    </PieChart>
  );
};

export default AverageSessionsChart;
